import React from "react";
import { Menu, Image } from "semantic-ui-react";

function Welcome(props) {
  let iconLocation;

  switch (localStorage.ranking) {
    case localStorage.ranking < 1500:
      iconLocation = "../images/rank icons/120px-Badge_1_Bronze.png";
      break;
    case localStorage.ranking < 2000:
      iconLocation = "../images/rank icons/120px-Badge_2_Silver.png";
      break;
    case localStorage.ranking < 2500:
      iconLocation = "../images/rank icons/120px-Badge_3_Gold.png";
      break;
    case localStorage.ranking < 3000:
      iconLocation = "../images/rank icons/120px-Badge_4_Platinum.png";
      break;
    case localStorage.ranking < 3500:
      iconLocation = "../images/rank icons/120px-Badge_5_Diamond.png";
      break;
    case localStorage.ranking < 4000:
      iconLocation = "../images/rank icons/120px-Badge_6_Master.png";
      break;
    default:
      iconLocation = "../images/rank icons/120px-Badge_7_Grandmaster.png";
  }

  return (
    <Menu.Item>
      <Image src={require(iconLocation)} />
    </Menu.Item>
  );
}

export default ProfileNewsItem;
